import React,{Component} from 'react';
import Client from '../consulta';
import TodoLabel from '../../src/componentes/biceLabel';


class Forma extends Component {
    constructor(props) {
      super(props);

      this.state = {
            name:'',
            salida:'',
            value: '',
            valor:'',
            persona:{ 
                nick: '',
                msg: '',
                created: { type: '', default: '' }
                },

            };
      this.handleChange = this.handleChange.bind(this);
      this.handleSubmit = this.handleSubmit.bind(this);
      this.handleInputChangeM= this.handleInputChangeM.bind(this);
    }
  
    handleChange(event) {
      this.setState({value: event.target.value});
    }
  
    handleSubmit(event) {
        let parte=JSON.stringify(this.state.value);
        console.log('marco1',parte)
        if(this.state.value){
            console.log('marco2',parte)
            Client.search("{ nick:"+parte+" }", respuesta => {
                console.log('marco3',respuesta)
                let guarda = (JSON.parse(respuesta));
                // this.setState( {salida:guarda}); 
                // this.refs.someName.value = '';
            });      
       }
      event.preventDefault();
    }

    // handleSubmitM(e) {
    //     e.preventDefault();
    //     this.props.onAddTodo(this.state);
    //     this.setState({
    //       title: '',
    //       responsible: '',
    //       description: '',
    //       priority: 'low'
    //     });
    //   }
    
      handleInputChangeM(e) {
        e.preventDefault();
        const {value, name} = e.target;
        console.log('que=',value, name);
//const esto='response.data.apis[0].example.response'
//const esto='{"response":{"data":{"apis":[{"example":{"response":"cobre"}}]}}}'
        const esto='{"pide":"' + value+ '" }'
        //Client.search("{ busque:"+value+" }", respuesta => {
          Client.search(esto, respuesta => {
            console.log('wow',respuesta)
            this.setState({
                name: respuesta
              });
      
        });      


        if(this.state.name){
            // console.log('existe=',this.state.name)
            // Client.search("{ nick:"+name+" }", respuesta => {
            //     console.log('marco3w',respuesta)
            // });      
        }

      }

    render() {

      let options3= this.state.salida;
      let muestra= this.state.name;


      return (

        <div className="card text-center border-info">
        
<h4 className="card-title">nada:{muestra}</h4>

{Object.entries(muestra).map(([key, subject], i) => (
    <li key={i}>
        <span >key: {i} Name: {subject.name}</span>
    </li>
))}


            <nav className="navbar navbar-expand-sm bg-dark navbar-dark">
                    <ul className="navbar-nav">
                        <li className="nav-item">
                        <a className="nav-link" href="/">menu1</a>
                        </li>
                        <li className="nav-item">
                        <a className="nav-link" href="/">menu2</a>
                        </li>
                    </ul>
            </nav>

             <div className="row">
                    <div className="col-sm-6">
                        <div className="card">
                        <div className="card-body">
                            <h5 className="card-title">Indicadores</h5>
                            <p className="card-text">Indicadore simportante busyness</p>
                            <form action="/pagina5/1" method="get" >
                                <button className="btn btn-primary"type="submit">Ir a indicadores</button>
                            </form>
                        </div>
                        </div>
                    </div>
                    <div className="col-sm-6">
                        <div className="card">
                        <div className="card-body">
                            <h5 className="card-title">Graficas</h5>
                            <p className="card-text">Graficas de indicador Dolar</p>
                            <form action="/pagina5/1" method="get" >
                                <button className="btn btn-primary"type="submit">Ir a graficas</button>
                            </form>
                        </div>
                        </div>
                    </div>
                    <div className="col-sm-6">
                        <div className="card">
                        <div className="card-body">
                            <h5 className="card-title">Curriculum</h5>
