                            <form action="/pagina5/1" method="get" >
                                <button className="btn btn-primary"type="submit">Ir a curriculum</button>
                            </form>
                        </div>
                        </div>
                    </div>
                    <div className="col-sm-6">
                        <div className="card">
                        <div className="card-body">
                            <h5 className="card-title">Bajo Construccion</h5>
